/*--- waitForKeyElements():  A utility function, for Greasemonkey scripts,
    that detects and handles AJAXed content.

    Usage example:

        waitForKeyElements (
            "div.comments"
            , commentCallbackFunction
        );

        //--- Page-specific function to do what we want when the node is found.
        function commentCallbackFunction (jNode) {
            jNode.text ("This comment changed by waitForKeyElements().");
        }

    IMPORTANT: This function requires your script to have loaded jQuery.
*/
function waitForKeyElements (
    selectorTxt,    /* Required: The jQuery selector string that
                        specifies the desired element(s).
                    */
    actionFunction, /* Required: The code to run when elements are
                        found. It is passed a jNode to the matched
                        element.
                    */
    bWaitOnce,      /* Optional: If false, will continue to scan for
                        new elements even after the first match is
                        found.
                    */
    iframeSelector  /* Optional: If set, identifies the iframe to
                        search.
                    */
) {
    var targetNodes, btargetsFound;

    if (typeof iframeSelector == "undefined")
        targetNodes     = $(selectorTxt);
    else
        targetNodes     = $(iframeSelector).contents ()
                                           .find (selectorTxt);

    if (targetNodes  &&  targetNodes.length > 0) {
        btargetsFound   = true;
        /*--- Found target node(s).  Go through each and act if they
            are new.
        */
        targetNodes.each ( function () {
            var jThis        = $(this);
            var alreadyFound = jThis.data ('alreadyFound')  ||  false;

            if (!alreadyFound) {
                //--- Call the payload function.
                var cancelFound     = actionFunction (jThis);
                if (cancelFound)
                    btargetsFound   = false;
                else
                    jThis.data ('alreadyFound', true);
            }
        } );
    }
    else {
        btargetsFound   = false;
    }

    //--- Get the timer-control variable for this selector.
    var controlObj      = waitForKeyElements.controlObj  ||  {};
    var controlKey      = selectorTxt.replace (/[^\w]/g, "_");
    var timeControl     = controlObj [controlKey];

    //--- Now set or clear the timer as appropriate.
    if (btargetsFound  &&  bWaitOnce  &&  timeControl) {
        //--- The only condition where we need to clear the timer.
        clearInterval (timeControl);
        delete controlObj [controlKey]
    }
    else {
        //--- Set a timer, if needed.
        if ( ! timeControl) {
            timeControl = setInterval ( function () {
                    waitForKeyElements (    selectorTxt,
                                            actionFunction,
                                            bWaitOnce,
                                            iframeSelector
                                        );
                },
                300
            );
            controlObj [controlKey] = timeControl;
        }
    }
    waitForKeyElements.controlObj   = controlObj;
}


// this has to be declared at the top or the waitForElements can't load it and pass it to our script
found_first_element = false;

// because service now is a piece of shit, we have to loop over the vt class, which is /actually/ reading the titles of 'other jobs this user has opened'
// which actually includes this job as well
// we can't use the actual sc_task.short_description since it's not the right type of element and yadda yadda, and all the other IDs generated by the system are basically 
// random
waitForKeyElements (
  ".vt",
  enableAudio
);

circus_now_main = "data:image/png;base64,";

function rollover(image_to_change)
{
  image_to_change.src = "https://i.vgy.me/AwBIkh.gif";
}

function rollaway(image_to_change)
{
  image_to_change.src = circus_now_main;
}

function enableAudio(urgentDetectElem)
{
  // use this cause there's a "few" vt class elems, this way we just get those with titles, and stop after the first one 
  // (see the comment above about other jobs)
  if (urgentDetectElem[0].title != "" && found_first_element == false)// and found_first_element == false)
  {
    found_first_element = true;
    // convert to lower case because it makes comparing easier
    ticket_title = urgentDetectElem[0].title.toLowerCase();
  
    // if Desc contains urgent, Urgent, URGENT, urgently, Urgently or URGENTLY
    // only need to check 'urgent' cause it's the root of all the above
    if(ticket_title.includes("urgent") || ticket_title.includes("!") || ticket_title.includes("phd") || ticket_title.includes("critical"))
    {
      //play the actual sound
      var player = document.createElement('audio');
      //purge siren (sort of)
      //player.src = 'https://www.myinstants.com/media/sounds/effect.mp3';
      //lmg airhorn
      player.src = 'https://www.myinstants.com/media/sounds/mlg-airhorn.mp3';
      player.preload = 'auto';
      player.volume = 0.5;
      player.play();
    }
  }
}

